import React, { useState, useEffect } from 'react';
import axios from 'axios';
import { TailSpin } from 'react-loader-spinner';
// import './comp1.css'
const Component1 = ({ onSubmit, org }) => {
  const [formData, setFormData] = useState({
    project: '',
    project_type: '',
    project_role: '',
    organization_name: org,
    industry_domains: 'Retail',
    funnel_stages: '',
    manage: '',
  });
  const [isFormValid, setIsFormValid] = useState(false);
  const [isLoading, setIsLoading] = useState(false);
  const [isProjectRegistered, setIsProjectRegistered] = useState('');

  const checkProjectRegistration = async () => {
    setIsLoading(true);
    try {
      const response = await axios.post('http://localhost:3001/check-project', {
        project: formData.project,
      });

      const data = response.data;
      const { details } = data;
      return details;
    } catch (error) {
      console.error('Error checking project registration:', error);
    } finally {
      setIsLoading(false);
    }
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    if (isFormValid) {
      const result = await checkProjectRegistration();
      if (result !== formData.project) {
        // changeId(2);
        onSubmit(formData);
        generateEmptyFormData();
      } else {
        setIsProjectRegistered('Project Exists');
      }
    }
  };

  const generateEmptyFormData = () => ({
    project: '',
    project_type: '',
    project_role: '',
    organization_name: '',
    industry_domains: '',
    funnel_stages: '',
    manage: '', // Default value added
  });

  const handleInputChange = (e) => {
    const { name, value } = e.target;
    setFormData((prevFormData) => ({
      ...prevFormData,
      [name]: value,
    }));
  };

  useEffect(() => {
    const form = document.getElementById('componentForm');
    setIsFormValid(
      Object.values(formData).every((value) => value !== '') && form.checkValidity()
    );
  }, [formData]);

  return (
    <form
      id="componentForm"
      cclassName="text-left max-w-full p-5 rounded-md"
      onSubmit={handleSubmit}
    >
      <h2 className="text-xl font-semibold mb-4">Create a project</h2>
      <br />
      <div className="flex">
        <div className="w-6/12">
          <h3 className="inline-block">Name</h3>
          <br />
          <input
            className="min-w-[200px] w-full max-w-[400px] mb-4 p-2 rounded-[5px] border-[#333] border-[solid]"
            type="text"
            name="project"
            value={formData.project}
            onChange={handleInputChange}
            required
          />
        </div>

        <div className="w-6/12">
          <h3 className="inline-block">Type</h3>
          <br />
          <select
            className="min-w-[200px] w-full max-w-[400px] mb-4 p-2 rounded-[5px]"
            name="project_type"
            value={formData.project_type}
            onChange={handleInputChange}
            required
          >
            <option value="" disabled hidden>
              Select a type of project
            </option>
            <option value="User Application">User Application</option>
            <option value="SDK">SDK</option>
            <option value="Protocol Stack">Protocol Stack</option>
          </select>
        </div>
      </div>

      <div className="flex">
        <div className="w-6/12">
          <h3 className="inline-block">Select Your Role</h3>
          <br />
          <select
            className="min-w-[200px] w-full max-w-[400px] mb-4 p-2 rounded-[5px]"
            name="project_role"
            value={formData.project_role}
            onChange={handleInputChange}
            required
          >
            <option value="" disabled hidden>
              Select your role
            </option>
            <option value="BAP">BAP</option>
            <option value="BPP">BPP</option>
            <option value="Beckn Gateway">Beckn Gateway</option>
            <option value="Beckn Registry">Beckn Registry</option>
          </select>
        </div>

        <div className="w-6/12">
          <h3 className="inline-block">Organization Name</h3>
          <br />
          <input
            className="min-w-[200px] w-full max-w-[400px] mb-4 p-2 rounded-[5px] border-[#333] border-[solid]"
            type="text"
            name="organization_name"
            value={formData.organization_name}
            onChange={handleInputChange}
            required
          />
        </div>
      </div>

      <div className="flex">
        <div className="w-6/12">
          <h3 className="inline-block">Industry Domain</h3>
          <br />
          <select
            className="min-w-[200px] w-full max-w-[400px] mb-4 p-2 rounded-[5px]"
            name="industry_domains"
            value={formData.industry_domain}
            onChange={handleInputChange}
            required
          >
            <option value="" disabled hidden>
              Select Industry Domain
            </option>
            <option value="Retail">Retail</option>
            <option value="Logistics">Logistics</option>
            <option value="Healthcare">Healthcare</option>
            <option value="Mobility">Mobility</option>
          </select>
        </div>

        <div className="w-6/12">
          <h3 className="inline-block">Funnel Stages</h3>
          <br />
          <select
            className="min-w-[200px] w-full max-w-[400px] mb-4 p-2 rounded-[5px]"
            name="funnel_stages"
            value={formData.funnel_stages}
            onChange={handleInputChange}
            required
          >
            <option value="" disabled hidden>
              Select Funnel Stages
            </option>
            <option value="Package 1">Package 1</option>
            <option value="Package 2">Package 2</option>
            <option value="Package 3">Package 3</option>
            <option value="Package 4">Package 4</option>
          </select>
        </div>
      </div>

      <h3>Do you want to manage?</h3>
      <div className="flex">
        <button
          type="button"
          name="manage"
          value="1"
          className={`cursor-pointer font-[bold] w-[200px] text-[#333] m-1 px-4 py-2 rounded-[5px]  ${formData.manage === '1' ? 'bg-[green] text-white' : ' bg-transparent border-green border-2 text-black'}`}
          onClick={handleInputChange}
        >
          Yes
        </button>
        <button
          type="button"
          name="manage"
          value="0"
          className={`cursor-pointer font-[bold] w-[200px] text-[#333] m-1 px-4 py-2 rounded-[5px] ${formData.manage === '0' ? 'bg-[red] text-white' : ' bg-transparent border-red border-2 text-black'}`}
          onClick={handleInputChange}
        >
          No
        </button>
      </div>
      <button className="bg-red-500 text-white font-bold py-2 px-4 rounded-md transform transition hover:scale-105 disabled:opacity-50" disabled={!isFormValid}>
        Save and Proceed
      </button>
      {isLoading && (
        <TailSpin type="ThreeDots" color="#00BFFF" height={50} width={50} />
      )}
      {!isFormValid && <p>Fill in the details</p>}
      <p>{isProjectRegistered}</p>
    </form>
  );
};

export default Component1;
